import React from 'react';

const UserList = ({ users, onUpdate, onDelete }) => {
    return (
        <div>
            <h2>All Users</h2>
            <ul>
                {users.map((user) => (
                    <li key={user._id}>
                        <strong>Name: {user.name}</strong>
                        <p>Email: {user.email}</p>
                        <p>Password: {user.password}</p>
                        <button onClick={() =>
                            onDelete(user._id)}>delete
                        </button>
                        }
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default UserList;
